[tÅe<?php exit; ?>a:1:{s:7:"content";O:8:"stdClass":24:{s:2:"ID";i:45;s:11:"post_author";s:1:"2";s:9:"post_date";s:19:"2014-12-18 23:02:01";s:13:"post_date_gmt";s:19:"2014-12-18 23:02:01";s:12:"post_content";s:22566:"<h3>Thank you very much for your interest in the NCALL/ABA webinar series on Abuse in Later Life. This webinar series has reached its maximum enrollment and is no longer accepting new registrants. If you would like to be notified of future webinars on the topic of Abuse in Later Life, please contact Shelly Fox of the National Clearinghouse on Abuse in Later Life at "sfox@ncall.us". Thank you.</h3>
<!-- 
<p><b>Overview:</b> The National Clearinghouse on Abuse in Later Life (NCALL) and the American Bar Association Commission on Domestic &amp; Sexual Violence have created a 5-part webinar series on Abuse in Later Life for civil attorneys, legal advocates and others who wish to gain a deeper understanding of Abuse in Later Life (ALL). The primary focus of these webinars will be addressing the needs of older victims of domestic violence and sexual assault. This series is sponsored by the U.S. Department of Justice Office on Violence Against Women (OVW). There will be no cost for webinar participants.</p>
<p><strong>Topics:</strong> The following webinars will be offered in this series:</p>
<ul>
<li><b>Module One: Abuse in Later Life: An Overview</b><br />Thursday, January 22, 2015, 2:00-3:00 pm E.S.T.</li>
<li><b>Module Two: Forming the Relationship with Your Client: Client communication, interview skills, and confidentiality/mandatory reporting concerns</b><br />Thursday, February 5, 2015, 2:00-3:00 pm E.S.T.</li>
<li><b>Module Three: Client Goal-Setting and Non-Litigation Responses: Client collaboration, developing client priorities and non-litigation responses to ALL</b><br />Thursday, February 19, 2015, 2:00-3:00 pm E.S.T.</li>
<li><b>Module Four: Legal Resolutions and Remedies in ALL cases: Protective orders, Guardianships, Power of Attorney agreements, end of life health care decision-making and working with the criminal justice system</b><br />Thursday, March 5, 2015, 2:00-3:00 pm E.S.T.</li>
<li><b>Module Five: Bringing the Case â€“ Trial Skills: Protection of evidence and assets, motion practice, witness testimony methods and supports, direct and cross-examination and application of the Crawford decision in ALL cases</b><br />Thursday, March 19, 2015, 2:00-3:00 pm E.S.T.</li>
</ul>
<p><b>Who should enroll:</b> The webinar series is tailored to the needs of civil attorneys and legal advocates. Registration, however, is open to all participants who wish to further develop their professional understanding of ALL.</p>
<p><b>Registration:</b> Registration for this series will open on Friday, December 19, 2014 and conclude on Friday, January 16, 2014.</p>
<p><b>CLE credits:</b>Â  Each participant who is seeking CLE credit will need to log in individually on their own computer in order to receive credit.</p>
<p>States typically decide whether a program qualifies for MCLE credit in their jurisdiction 4-8 weeks after the program application is submitted. For many live events, credit approval is not received prior to the program.</p>
<p>The ABA applies for and ordinarily receives CLE credit for ABA live webinars and teleconferences in AL, AK, AR, AZ, CA, CO, DE, GA, GU, HI, IA, IL, IN, KS, KY, LA, MN, MO, MT, NH, NM, NY, NC, ND, OK, OR, SC, TN, TX, UT, VA, VI, VT, WA, WI, and WV.</p>
<p>The ABA does not seek direct accreditation of live webinars and teleconferences in FL, ID, ME, NE, NJ, OH, PA, RI, and WY. Some states allow attorneys to earn credit through reciprocity or self-submission. View accreditation information for your state: <a href="http://www.americanbar.org/publications_cle/mandatory_cle.html" target="_blank" rel="noopener">http://www.americanbar.org/publications_cle/mandatory_cle.html</a>.</p>
<p><b><span style="font-size: 9.0pt; font-family: Tahoma; mso-bidi-font-family: Tahoma; color: #333333;">Questions:</span></b><span style="font-size: 9.0pt; font-family: Tahoma; mso-bidi-font-family: Tahoma; color: #333333;">Â Please contact Shelly Fox at NCALL if you have additional questions regarding this webinar series:</span></p>
